            if (applicationSession.IntegrationId == null)
                throw new ArgumentNullException(nameof(applicationSession.IntegrationId), "Property is required for class ApplicationSession.");

            if (applicationSession.Coupon == null)
                throw new ArgumentNullException(nameof(applicationSession.Coupon), "Property is required for class ApplicationSession.");

            if (applicationSession.Referral == null)
                throw new ArgumentNullException(nameof(applicationSession.Referral), "Property is required for class ApplicationSession.");

            if (applicationSession.CartItems == null)
                throw new ArgumentNullException(nameof(applicationSession.CartItems), "Property is required for class ApplicationSession.");

            if (applicationSession.Discounts == null)
                throw new ArgumentNullException(nameof(applicationSession.Discounts), "Property is required for class ApplicationSession.");

            if (applicationSession.StoreIntegrationIdOption.IsSet && applicationSession.StoreIntegrationId == null)
                throw new ArgumentNullException(nameof(applicationSession.StoreIntegrationId), "Property is required for class ApplicationSession.");

            if (applicationSession.ProfileintegrationidOption.IsSet && applicationSession.Profileintegrationid == null)
                throw new ArgumentNullException(nameof(applicationSession.Profileintegrationid), "Property is required for class ApplicationSession.");

            if (applicationSession.AttributesOption.IsSet && applicationSession.Attributes == null)
                throw new ArgumentNullException(nameof(applicationSession.Attributes), "Property is required for class ApplicationSession.");

            writer.WriteNumber("id", applicationSession.Id);

            writer.WriteString("created", applicationSession.Created.ToString(CreatedFormat));

            writer.WriteString("integrationId", applicationSession.IntegrationId);

            writer.WriteNumber("applicationId", applicationSession.ApplicationId);

            writer.WriteString("coupon", applicationSession.Coupon);

            writer.WriteString("referral", applicationSession.Referral);

            var stateRawValue = ApplicationSession.StateEnumToJsonValue(applicationSession.State);
            writer.WriteString("state", stateRawValue);
            writer.WritePropertyName("cartItems");
            JsonSerializer.Serialize(writer, applicationSession.CartItems, jsonSerializerOptions);
            writer.WritePropertyName("discounts");
            JsonSerializer.Serialize(writer, applicationSession.Discounts, jsonSerializerOptions);
            writer.WriteNumber("totalDiscounts", applicationSession.TotalDiscounts);

            writer.WriteNumber("total", applicationSession.Total);

            if (applicationSession.StoreIntegrationIdOption.IsSet)
                writer.WriteString("storeIntegrationId", applicationSession.StoreIntegrationId);

            if (applicationSession.ProfileIdOption.IsSet)
                writer.WriteNumber("profileId", applicationSession.ProfileIdOption.Value.Value);

            if (applicationSession.ProfileintegrationidOption.IsSet)
                writer.WriteString("profileintegrationid", applicationSession.Profileintegrationid);

            if (applicationSession.AttributesOption.IsSet)
            {
                writer.WritePropertyName("attributes");
                JsonSerializer.Serialize(writer, applicationSession.Attributes, jsonSerializerOptions);
            }
        }
    }
